var title_f16_30_16876="Myelopoiesis knockouts";
var content_f16_30_16876=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F67668&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F67668&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Phenotypes of mice lacking specific hematopoietic growth factors or growth factor receptors",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Phenotype",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Missing hematopoietic growth factor or growth factor receptor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        GM-CSF",
"       </td>",
"       <td>",
"        Normal hematopoiesis and progenitors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Progressive accumulation of pulmonary surfactant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        G-CSF",
"       </td>",
"       <td>",
"        Circulating neutrophils 25 percent of normal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Progenitors 50 percent of normal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Impaired response to Listeria monocytogenes infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        IL-3/GM-CSF/IL-5 (bc) receptor",
"       </td>",
"       <td>",
"        Similar to mice lacking GM-CSF",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Low eosinophils and impaired eosinophil response to N. brasiliensis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Missing transcription factor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        PU.1",
"       </td>",
"       <td>",
"        Embryonically lethal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Absence of granulocytes, monocytes, T and B lymphocytes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        C/EBP-alpha",
"       </td>",
"       <td>",
"        Death soon after birth",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Absent neutrophils and eosinophils",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Impaired glucose metabolism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        C/EBP-beta",
"       </td>",
"       <td>",
"        Defective monocytes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Myelodysplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        C/EBP-epsilon",
"       </td>",
"       <td>",
"        Early death from opportunistic infection and myelodysplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Specific granule deficiency and abnormal neutrophil function",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        AML1 or CBF-beta",
"       </td>",
"       <td>",
"        Embryonically lethal due to failure of hematopoiesis",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     For references, please refer to the UpToDate topic on the&nbsp;regulation of myelopoiesis.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
